import Home from "./components/Home";
import { Route } from "react-router-dom";
import ProductPage from "./components/ProductPage";

function App() {
  return (
    <div>
      <Route path="/m">
        <Navbar />
        <Home />
      </Route>
      <Route path="/productPage/:productI">
        <Navbar />
        <ProductPage />
      </Route>
    </div>
  );
}

export default App;
